import React from 'react'
import { useEffect, useState } from "react";
const RoomList = () => {

    const [rooms, getData] = useState([])
    const URL = 'https://gruppe18.toni-barth.com/rooms/';
    const datalist = rooms.map(room => <h2>{room}</h2>)
    useEffect(() => {
      fetchData()
    }, [])
  
  
    const fetchData = () => {
      fetch(URL)
        .then((res) =>
          res.json())
  
        .then((response) => {
          console.log(response);
          getData(response);
        }).then()
        
    }



  return (
    <div>{datalist}</div>
  )
}

export default RoomList
